import "./heroimage.css"
import backimage from "../assets/image.jpg"
import React from 'react'

const heroimage = () => {
  return (
    <div className="Hero">
      <div className="Mask">
        <img className="backimage" src = {backimage} alt = "backimage"/>
      </div>
    </div>
  )
}

export default heroimage;
